webpackJsonp([96694461010892],{1158:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Honestly, I can say that I’ve never stressed out about any holiday. But then, I’m not one of those seemingly endless line of folks on HGTV worried about creating an entertaining space in my house. I don’t entertain. That’s just me. Still, I realize that “the holidays” can be very stressful for other people, so I wanted to share my particular zen-master chill with others. Enjoy this Powtoon video.</p>\n<p><div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.49999999999999%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe src="https://www.youtube.com/embed/Wx6gB9PKBjY?rel=0" class="embedVideoIframe" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n      <style>\n        .embedVideoIframe {\n          border: 0\n        }\n      </style>\n          </div>\n          </div></p>',frontmatter:{date:"December 08, 2014",path:"/blog/elh-challenge-surviving-the-holidays",title:"ELH Challenge: Surviving the Holidays",tags:["humor","powtoon","video"],categories:["Elearning Heroes Challenge","Tips"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.768172888015717,src:"/static/logoColor-c92143fb3723fcd5f12c0d0502759756-81d39.png",srcSet:"/static/logoColor-c92143fb3723fcd5f12c0d0502759756-9a8d1.png 203w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-c53f9.png 405w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-81d39.png 810w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-e81a9.png 900w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
